import Layout from '../components/Layout';
import Search from '../components/Search';

const Index = () => (

    <Layout>
        <div>
            <h1>CSC 648/848 SW Engineering Fall 2020</h1>
        </div>
        <div>    
            <Search/>
        </div>

        <div id="btn-wrapper">
            <a className="fire-btn" href="/wildfires_page">Wildfires</a>

            <a className="fire-btn" href="/covid_page">Coronavirus</a>
        </div>
    </Layout>   

);



export default Index;
